import React, { Component } from 'react'

class AddUser extends Component {
    render() {
        return (
            <form className="container my-5">       {/* Since we installed Bootstrap, we can grab form syntax from Bootstrap website */}
                <div className="form-group">
                    <label for="userName"> Username </label>
                    <input type="text" className="form-control" aria-describedby="username" />
                </div>
                <div className="form-group">
                    <label for="id"> ID </label>
                    <input type="text" className="form-control" area-describedby="id" />
                </div>

                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
        )
    }
}

export default AddUser
